import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Welcome from "./components/Welcome";
import AboutSection from "./components/AboutSection";
import CarouselSection from "./components/CarouselSection";
import ReservationForm from "./components/ReservationForm";
import ContactSection from "./components/ContactSection";
import Footer from "./components/Footer";
import "bootstrap/dist/css/bootstrap.min.css";
import Menu from "./components/Menu";
import Available from "./components/Available";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route
          path="/"
          element={
            <>
              <Welcome />
              <AboutSection />
              <CarouselSection />
              <ContactSection />
              <Footer />
            </>
          }
        />
        <Route
          path="/about"
          element={
            <>
              <AboutSection />
              <Footer />
            </>
          }
        />
        <Route
          path="/reservation"
          element={
            <>
              <ReservationForm />
              <Footer />
            </>
          }
        />
        <Route
          path="/contact"
          element={
            <>
              <ContactSection />
              <Footer />
            </>
          }
        />
        <Route
          path="/menu"
          element={
            <>
              <Menu />
              <Footer />
            </>
          }
        />
        <Route
          path="/ const menuItems = [
    { id: 1, name: 'Pasta Carbonara', description: 'Creamy pasta with bacon and Parmesan cheese', price: '₹999', image: require('../menu-img/pasta_carbonara.jpg'), },
    { id: 2, name: 'Margherita Pizza', description: 'Classic pizza with tomato sauce, mozzarella, and basil', price: '₹799', image: require('../menu-img/margherita_pizza.jpg') },
    { id: 3, name: 'Chicken Tikka Masala', description: 'Tender chicken in a creamy spiced tomato sauce', price: '₹899', image: require('../menu-img/chicken_tikka_masala.jpg') },
    { id: 4, name: 'Caesar Salad', description: 'Crisp romaine lettuce with croutons, Parmesan cheese, and Caesar dressing', price: '₹599', image: require('../menu-img/caesar_salad.jpg') },
    { id: 5, name: 'Sushi Platter', description: 'Assorted sushi rolls with soy sauce and pickled ginger', price: '₹1299', image: require('../menu-img/sushi_platter.jpg') },
    { id: 6, name: 'BBQ Ribs', description: 'Tender ribs glazed with barbecue sauce, served with coleslaw', price: '₹1099', image: require('../menu-img/bbq_ribs.jpg') },
    { id: 7, name: 'Vegetable Stir-Fry', description: 'Fresh mixed vegetables sautéed with soy sauce', price: '₹749', image: require('../menu-img/vegetable_stir_fry.jpg') },
    { id: 8, name: 'Tiramisu', description: 'Classic Italian dessert with layers of coffee-soaked ladyfingers and mascarpone cheese', price: '₹649', image: require('../menu-img/tiramisu.jpg') },
    { id: 9, name: 'Beef Burger', description: 'Juicy beef patty with lettuce, tomato, and cheese in a sesame seed bun', price: '₹899', image: require('../menu-img/beef_burger.jpg') },
    { id: 10, name: 'Pad Thai Noodles', description: 'Stir-fried rice noodles with shrimp, tofu, peanuts, and tamarind sauce', price: '₹849', image: require('../menu-img/pad_thai_noodles.jpg') },
    { id: 11, name: 'Caprese Salad', description: 'Fresh mozzarella, tomatoes, and basil drizzled with balsamic glaze', price: '₹699', image: require('../menu-img/caprese_salad.jpg') },
    { id: 12, name: 'Chicken Alfredo', description: 'Creamy pasta with grilled chicken, Parmesan cheese, and Alfredo sauce', price: '₹999', image: require('../menu-img/chicken_alfredo.jpg') },
    { id: 13, name: 'Mushroom Risotto', description: 'Creamy Italian rice dish with mushrooms and Parmesan cheese', price: '₹799', image: require('../menu-img/mushroom_risotto.jpg') },
    { id: 14, name: 'Cheese Platter', description: 'Assorted cheeses with crackers and fruits', price: '₹1199', image: require('../menu-img/cheese_platter.jpg') },
    { id: 15, name: 'Chocolate Fondue', description: 'Rich melted chocolate with fruits and marshmallows for dipping', price: '₹699', image: require('../menu-img/chocolate_fondue.jpg') },
  ];"
          element={
            <>
              <Available />
              <Footer />
            </>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
